import './App.css';
import Dashboard from './dasboahrd/Dasboard';
import NavbarMenu from './NavBar/navbar';
import {BrowserRouter as Router, Route,} from 'react-router-dom';
import Trabajadores from './Trabajadores/trabajadores';
import Evaluacion from './Evaluacion/evaluacion';

const App=() => {
  return (
<Router>
        <div>
          <NavbarMenu/>
            <Route exact path="/" component={Dashboard} />
            <Route path="/Trabajadores" component={Trabajadores} />
            <Route path="/Evaluacion" component={Evaluacion} />
        </div>        
      </Router>
  );
}

export default App;
